import json

def load_translations(language):
    """Load translations from a JSON file."""
    try:
        with open(f'{language}.json') as f:
            return json.load(f)
    except FileNotFoundError:
        raise ValueError(f"Translation file for language '{language}' not found.")

def get_translation(translations, key):
    """Retrieve a translated string from a dictionary."""
    return translations.get(key)

def get_content(language, key):
    """Retrieve a translated string from a file."""
    translations = load_translations(language)
    return get_translation(translations, key)
