def build_job(self, job_name):
    build_url = f"{self.base_url}/build"
    data = {"job_name": job_name}
    response = self.session.post(build_url, data=data, params={'job_id': job_name})
    if response.status_code == 200:
        print(f"Job {job_name} built successfully")
    else:
        print(f"Failed to build job {job_name}")
